export const getPosts = () => {
  return async dispatch => {
    dispatch(loading(true));

    const res = await axios.get('http://localhost:8080/posts');
    
    setTimeout(() => {
      dispatch(setPosts(res.data));
      dispatch(loading(false));
    }, 1000)
  }
}
